INSERT INTO `cms_page` VALUES (1,'404 Not Found','2columns-right','Page keywords','Page description','no-route','Whoops, our bad...','<dl>\r\n<dt>The page you requested was not found, and we have a fine guess why.</dt>\r\n<dd>\r\n<ul class=\"disc\">\r\n<li>If you typed the URL directly, please make sure the spelling is correct.</li>\r\n<li>If you clicked on a link to get here, the link is outdated.</li>\r\n</ul></dd>\r\n</dl>\r\n<dl>\r\n<dt>What can you do?</dt>\r\n<dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\r\n<dd>\r\n<ul class=\"disc\">\r\n<li><a href=\"#\" onclick=\"history.go(-1); return false;\">Go back</a> to the previous page.</li>\r\n<li>Use the search bar at the top of the page to search for your products.</li>\r\n<li>Follow these links to get you back on track!<br /><a href=\"{{store url=\"\"}}\">Store Home</a> <span class=\"separator\">|</span> <a href=\"{{store url=\"customer/account\"}}\">My Account</a></li></ul></dd></dl>\r\n','2017-09-21 10:04:48','2017-09-21 10:04:48',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2,'Home Page','1column','','','home','Home Page','<div id=\"gc-wrapper\" class=\"AXP_CenterContent AXP_Responsive gc-page-home   FF_5   gc-wrapper      res_Large res_1300\">\r\n<div class=\"gc-main-content\">\r\n<div id=\"gift-card-hero\"><section class=\"section-hero\">\r\n<div class=\"gc-max-width\">\r\n<div class=\"gc-show-desktop section-hero-desktop row no-gutters\"><img class=\"falling-cards\" src=\"{{view url=\'images/falling-cards-with-shadow.png\'}}\" alt=\"Gift Cards and Business Gift Cards from American Express\" />\r\n<h1 class=\"eyebrow\">Gift Cards and Business Gift Cards</h1>\r\n<div class=\"section-hero-details col-6 offset-6 clearfix\" style=\"padding-top: 2rem;\"><img class=\"for-you\" src=\"{{view url=\"images/for-you.png\"}}\" alt=\"For You\" />\r\n<div class=\"cta-container\">\r\n<p>Say&nbsp;Congrats, Happy&nbsp;Birthday, Keep&nbsp;It&nbsp;Up and Thank&nbsp;You.<span 